(3, 'Dr. M.K. Sharma', 'x010/x010/x010', 'FCSA', 'A1', 'Professor', 'X010', 'X010', 'X010', 'MBA, M. Tech.,Ph.D.', 'x', 'x', '3.png', '3.docx', 'Prof. (Dr.) M.K. Sharma is associated with Amrapali Group of Institutes from last 16 Years , Presently He is working as Professor of Computer Science and Applications , he has 16 years of  teaching experience in PG and UG courses including MCA, M.Tech and Ph.D Students , He has Authored 10 books  on Different Subjects of Computer Science  and  contributed many research papers and articles in international ,national journals and magazine  , 6 Ph.d Scholars have been completed their Ph.D in His Guidance and 5 are perusing , Member of USERC (Uttarakhand), He Member of board of Studies and Research Committee of Kumaun University , HNB Gharwal University , Uttarakhand Open University , Uttarakhand Technical University, Trithankar Mahaveer Uniersity , Dev Sanskriti University ,Haridwar and many more ', 'sharmamkhld@gmail.com', '9897562188', 'dirmca', 1, '2017-12-23 13:30:07'),
(4, 'Dr. Raj Kishore Bisht', 'x010/x010/x010', 'FCSA', 'A12', 'Associate Professor', 'X010', 'X010', 'X010', 'M.Sc., Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '2017-12-23 13:30:07'),
(5, 'Mr. Ashish Bhushan Khare', 'x010/x010/x010', 'FCSA', 'A2', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, Pursuing Ph.D.', 'x', 'x', '5.jpg', '5.docx', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA from HNBG University, Srinagar Garhwal, Uttarakhand in Year 2003. I am having academic experience of 12.5 years with BCA and MCA programme. My specialization includes Operating Systems, Computer Networks, Mobile Communication, E-governance and Computer System Architecture.  My other areas of interest include Parallel Computing, Data Mining and Warehousing and Cloud Computing. I am pursuing my Ph. D in Computer Science from Bhagwant University, Ajmer and in award of same; I have successfully submitted my Pre-thesis and completed my Pre-Ph. D presentation. I have my research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'kharegeminine8@gmail.com', '9927016736', 'dirmca', 1, '2017-12-23 13:30:07'),
(6, 'Dr. Nitin Deepak', 'x010/x010/x010', 'FCSA', 'A21', 'Asst. Professor', 'X010', 'X010', 'X010', 'Ph.D., MCA, M.Phil', 'x', 'x', '6.jpg', '6.pdf', 'Dr. Nitin Deepak is associated with Amrapali Group of Institutes from last 12 Years. Presently He is working as Asst. Professor of Computer Science and Applications , he has 12 years of  teaching experience in PG and UG courses including MCA, BCA. He has contributed many research papers and articles in international, national journals and magazine, guiding 1 Ph.d Scholar. His specialization includes Algorithms, Software Engineering, Data-Structure and Web-Technology and above passionate about web and app development.', 'nitin.d12@gmail.com', '9760020667', 'dirmca', 1, '2017-12-23 13:30:07'),
(7, 'Mr. Mukesh Joshi', 'x010/x010/x010', 'FCSA', 'A22', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, M.Phil., pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '2017-12-23 13:30:07'),
(8, 'Dr. H.S Jalal', 'x010/x010/x010', 'FCSA', 'A23', 'Asst. Professor', 'X010', 'X010', 'X010', 'Ph.D., MCA, M.Com, DOEACC A Level,  PGDECOM.', 'x', 'x', '8.jpg', '8.docx', 'Dr. Hitender Singh Jalal is a teacher, speaker, advisor and researcher. He joined the Institute on Apr 12, 2002. He has 19 years of teaching experience. He is Master of Commerce & Computer Applications. He has been awarded a Ph.D. in Computer Science. His area of specialization is Pervasive Computing, Accounting & Financial Management, Programming Languages and Multimedia.  He has published several research papers in national and international journals and attended various seminars and conferences in the field of Computer Science.', 'jalalhemu@gmail.com', '9897122528', 'dirmca', 1, '2017-12-23 13:30:07'),
(9, 'Mr. Nandan Singh Dasila', 'x010/x010/x010', 'FCSA', 'A24', 'Asst. Professor', 'X010', 'X010', 'X010', 'M.CA, pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '2017-12-23 13:30:07'),
