(11, 'Dr. Naveen Tewari', 'x010/x010/x010', 'FCSA', 'A26', 'Asst. Professor', 'X010', 'X010', 'X010', 'PhD, MCA, Developer in Multimedia, CIH', 'x', 'x', '11.jpg', '11.docx', 'Dr. Naveen Tewari is associated with Amrapali Group of Institutes from last 9 Years. Presently He is working as Asst. Professor of Computer Science and Applications, he has 9 years of  teaching experience in PG and UG courses including MCA, BCA. He has contributed many research papers and articles in international, national journals and magazine. 2 Scholar are persuing PhD under his guidance. His specialization includes Data-Structure, Programming methodology and Web-Technology.', 'navtewari@gmail.com', '7895089999', 'dirmca', 1, '2017-12-23 13:30:07'),
(12, 'Mr. H.V. Pant', 'x010/x010/x010', 'FCSA', 'A31', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', '12.JPG', '12.docx', 'I have evolved as an academician primarily during my stint at the Amrapali Group Of Institute, which I joined in 2002 as a Lab Instructor. During the first few years, I was posted in the Computer Lab that exists as per Kumaun University’s mandate. Since my promotion as Lecturer in 2009, my primary job responsibility has been to teach various subjects, viz. DataBase, Visual Basic, Network Operating System, C, C++ and Business Data Processing. During the semester currently underway, I am teaching Network Operating System and Business Data Processing subjects to students of Bachelor of Computer Applications course and guiding students of Master of Computer Applications course in various projects in Visual Basic subject. Apart from classroom teaching, I have been entrusted with additional responsibilities, the performance of which has enhanced my capabilities and skills. These opportunities have led me to improve consistently as a professional as well as an academician.', 'pant.vardhan@gmail.com', '8192850007', 'dirmca', 1, '2017-12-23 13:30:07'),
(13, 'Mr. Suresh Ch. Wariyal', 'x010/x010/x010', 'FCSA', 'A33', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA, pursuing Ph.D.', 'x', 'x', '13.jpg', '13.doc', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA from Kumaun University, Nainital, Uttarakhand in Year 2006.I have been also awarded degree of M.Tech fro Uttrakhand Technical University in 2012. I am having academic experience of 9 years with BCA and MCA programme. My specialization includes Operating Systems, Computer Networks, Enterprise Resource Planning and Advance database management. I am pursuing my Ph. D in Computer Science from Bhagwant University, Ajmer. I have my research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'swariyal@gmail.com', '9927367445', 'dirmca', 1, '2017-12-23 13:30:07'),
(14, 'Mr. Nitin Pandey', 'x010/x010/x010', 'FCSA', 'A36', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA, pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '2017-12-23 13:30:07'),
