(16, 'Mr. Ankush Joshi', 'x010/x010/x010', 'FCSA', 'A41', 'Lecturer', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', '16.jpg', '16.doc', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA and M.Tech ( CSE) from Uttarakhand Technical University, Dehradun. I am having academic experience of more than 7 years with BCA and MCA programme. My specialization includes JAVA (Core), DBMS, Operating Systems. I have 4 research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'ankushjoshi1987@gmail.com', '9627458333', 'dirmca', 1, '2017-12-23 13:30:07'),
