(23, 'Dr. Jyoti    Singh', 'x010/x010/x010', 'FTS', 'B2', 'Associate Professor', 'x', 'x', 'x', 'Ph.D (Chemistry)', 'x', 'x', '23.jpg', '23.docx', '"My name is Dr. Jyoti Singh, I have completed my M.Sc. (Inorganic Chemistry) in 1998, Ph.D. (Drug Designing) in (2003) from APS University Rewa (MP) and PGDCA (2000) has completed from Makhan Lal National Journalism University, Bhopal (MP). \nPrior to joining Amrapali, I had joined the Delhi College of Engineering (DCE) as a lecturer on contract basis. I have a teaching experience of about 19 years, out of which 8 years I had worked as a lecturer at the Government Higher Secondary School, but had to leave job due to poor salary and interior area. Apart from this, I have also done CSIR and UGC Sponsored Projects, I had also worked as a lecturer in Dept. of Chemistry APS University Rewa.\nMy aim is to develop new ideas in teaching & learning and creates very interesting and innovative ways to move my Institute forward in the field of education. Seeking a position to utilize my skills and abilities in an education that offers professional growth while being resourceful, innovative and flexi', 'jyotisingh.dtu@gmail.com', '9837377366', 'diraits', 1, '2017-12-23 13:30:07'),
