(122, 'Prof.(Dr.) Ritvik Dubey ', 'x010/x010/x010', 'FCBM', 'A1', ' Director', 'X010', 'X010', 'X010', 'MMS,PhD,BBA,UGC NET(Management)', 'x', 'x', 'sample.jpg', '122.doc', '\r\nDr. Ritvik Dubey is  an astute scholar and administrator having more than 14 years of teaching,administrative and research experience.Currently he is working as Professor(Director) at Amrapali Group of Institutes, Haldwani. \r\nHe has conducted many workshops,seminars,study trips and conferences.\r\nDuring his academic career he has published more than 5 papers in national/ international journals and participated more than 10 National Seminar/Conferences.\r\nHe is alumni of prestigious Universities of Allahabad and Lucknow.\r\n', 'ritvikdubey@gmail.com', '8126096191', 'dirmba', 1, '2017-12-23 13:30:07'),
(123, 'Dr. P. K.Shah', 'x010/x010/x010', 'FCBM', 'A2', 'Professor', 'X010', 'X010', 'X010', 'PhD,LLB,MBA,MA M.Com,B.Com', 'x', 'x', '123.jpg', '123.pdf', 'Dr. P.K.Shah  is having more than 26 years of experience as an academician. Currently he is working as Professor at Amrapali Group of Institutes, Haldwani. Three PhD scholars have recently awarded their degree from UTU Dehradun and 3 more scholars are presently pursuing their PhD under his guidance. During his academic career he has presented more than 6 research papers in international conferences and seminars. He has published 15 papers in national/ international journals and attended more than 35 National Seminar organized by different Universities & Govt. colleges of the Northern states of India in different issues.', 'shahpkumar@gmail.com', '9568222007', 'dirmba', 1, '2017-12-23 13:30:07'),
(124, 'Prof.(Dr.) Siddhartha Sharma ', 'x010/x010/x010', 'FCBM', 'A3', 'Professor', 'X010', 'X010', 'X010', 'x', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '2017-12-23 13:30:07'),
(125, 'Mr. Deep Chandra', 'x010/x010/x010', 'FCBM', 'A4', 'Associate Professor', 'X010', 'X010', 'X010', 'M.Sc. , MBA ', 'x', 'x', '125.jpg', '125.pdf', 'Deep Chandra is an experienced banker turned academician, retired as Vice President from Nainital Bank Ltd, after serving the Bank for 33years .Currently working with Amrapali Group Of Institutes, Haldwani as Associate Professor. Exhibited ability of people management, business development and public relations  throughout the service tenure with this ability and experience imparting practical knowledge to the students of management. He is Ph.D. (Management) pursuing, MBA with specialization in finance, M.Sc. (statistics), CAIIB.', 'deep_chandra56@yahoo.co.in', '9568745333', 'dirmba', 1, '2017-12-23 13:30:07'),
(126, 'Dr. A. K. Srivastava', 'x010/x010/x010', 'FCBM', 'A50', 'Associate Professor', 'X010', 'X010', 'X010', 'MA. (Eco.), M.COM, PhD', 'x', 'x', 'sample.jpg', '126.docx', 'Dr. A.K.Srivastava have ninteen year of teaching experience in different institutes.\r\n', 'drsrivastavaanand@gmail.com', '9452536637', 'nitin', 1, '2017-12-23 13:30:07'),
(127, 'Dr. Deepika S. Joshi', 'x010/x010/x010', 'FCBM', 'A6', 'Associate Professor', 'X010', 'X010', 'X010', 'MCA,MBA,Ph.D', 'x', 'x', '127.jpg', '127.docx', '"Dr. Deepika S. Joshi is an accomplished educator with monstrated ability to teach, motivate, and direct students while maintaining high interest and achievement. Offering sterling experience of 18+\r\nyears, of which 16+ years have been in the field of academics. She is Ph.D. (Management), MCA, MBA with specialization in HR. Presently, designated as an Associate Professor (Faculty of Commerce & Business Management) at Amrapali Group of Institutes, Haldwani, Uttarakhand."\r\n', 'dsagta@gmail.com', '9899882346', 'dirmba', 1, '2017-12-23 13:30:07'),
(128, 'Dr. Garima Jaiswal Chandra', 'x010/x010/x010', 'FCBM', 'A7', 'Assistant Professor', 'X010', 'X010', 'X010', 'MBA , NET, USET, PhD', 'x', 'x', '128.JPG', '128.doc', '"Dr. Garima Jaiswal Chandra is an Assistant professor in the areas of Finance and General Management with more than 12 years of experience in academics. She is UGC-Net, USET qualified in Management and currently pursuing MCom. \r\nDuring her career as a management teacher, she has conducted FDPs , Seminar and been a resource person for training programmes conducted for the Ministry of MSME. During her academic career she has presented several research papers in national and international conferences. Her published work includes research papers in national and international journals. Her research interest includes the study of venture capital, security market, and financial management. \r\n"\r\n', 'garimain2001@gmail.com', '9410166600', 'dirmba', 1, '2017-12-23 13:30:07'),
(129, 'Dr. Ashok Kr. Gupta', 'x010/x010/x010', 'FCBM', 'A8', 'Assistant Professor', 'X010', 'X010', 'X010', 'Ph. D.', 'x', 'x', 'sample.jpg', '129.docx', 'Dr. Ashok K. Gupta have completed M. Sc. in Mathematics from Agra University; M. Tech. from Devi Ahilya University, Indore and Ph. D. from Devi Ahilya University as well as CSIR-National Physical Laboratory, New Delhi. During my Ph. D. degree, He had worked as a SRF-CSIR. After completion of Ph. D., He worked as a RA-PRL Ahmedabad/ISRO and Pool Scientist-CSIR for a period of around 10 years.He have been to Antarctica as a winter team member of 22nd Indian Scientific Expedition to Antarctica for a period of around 16 months. He have also been to International Centre for Theoretical Physics (ICTP), Triest, Italy for research assignment. He have several research papers to my credit which are published in National and International Journals and National and International conferences. He also worked as a Faculty i.e. Asstt. Prof. as well as Assoc. Prof. at SIMS, Ghaziabad for a period of around 2 years. At present, he is working as an Asstt. Prof. at AGI, Haldwani, (U. K.).  \r\n', 'ashok_kumarg@yahoo.com', '9639116124', 'dirmba', 1, '2017-12-23 13:30:07'),
(130, 'Dr. Gaurav Pant ', 'x010/x010/x010', 'FCBM', 'A9', 'Assistant Professor', 'X010', 'X010', 'X010', 'M.Com; MBA; M.Phil (Commerce);Ph.D; UGC NET (Commerce, Management); USET (Commerce); CWA (inter); PGDHRM;', 'x', 'x', '130.jpg', '130.docx', 'Dr. Gaurav Pant is Working as a Assistant Professor in Faculty of Commerce and Business Management since Feburary 2013, before joining the institute he had worked as a Assistant Manager (Financial Services) in a Sec. 25 Company formed by UGVS to implement IFAD and Uttarakhand Government funded project. Interest areas are Accounting and Finance.\r\n', 'gauravugc2012@gmail.com', '8477999577', 'dirmba', 1, '2017-12-23 13:30:07'),
(131, 'Dr. Hem Chandra Kothari ', 'x010/x010/x010', 'FCBM', 'B10', 'Assistant Professor', 'X010', 'X010', 'X010', 'M.Com., MBA (Finance), PGDBEF, NET (Commerce), SET(Commerece), Ph.D.', 'x', 'x', '131.jpg', '131.doc', 'Dr. Hem Chandra Kothari is a Highly motivated academician with specialisation in Accounting and Finance. He hold masters (M.Com.)  and Ph. D. in Commerce. His  research area of interest is Financial Econometrics, Stock Market Behaviour, and Entrepreneurship. He have got sixteen research papers published in National and International Journals of repute. He have attended ten national and international conferences, three FDPs on entrepreneurship, one FDP on Finance and two workshops on handling data in SPSS. He have been an Expert and co-convener in National and Inaternational Conferences.He also a paper setter of Uttaranchal University, Dehradun, Graphic Era University, Dehradun, and some other Universities.He have an experience to teach both UG and PG classes. Subjects in which he is specialized are; Financial Accounting, Financial Management, Management Accounting, Cost Accounting, Security Analysis and Portfolio Management, Entrepreneurship Development, Statistics for Management, Rese', 'hckothari33@gmail.com', '8958917291', 'nitin', 1, '2017-12-23 13:30:07'),
(132, 'Dr. Priyanka Dhingra', 'x010/x010/x010', 'FCBM', 'B11', 'Assistant Professor', 'X010', 'X010', 'X010', 'PhD,MBA,BBA', 'x', 'x', '132.jpg', '132.docx', 'Dr. Priyanka Dhingra is having more than 6 years experience as an Assistant Professor at Amrapali Group of Institutes.', 'priyankaasagi@gmail.com', '9897578208', 'dirmba', 1, '2017-12-23 13:30:07'),
(133, 'Ms. Anjali Dhingra', 'x010/x010/x010', 'FCBM', 'B12', 'Assistant Professor', 'X010', 'X010', 'X010', 'PGDBA', 'x', 'x', '133.jpg', 'x', '', '', '', 'dirmba', 1, '2017-12-23 13:30:07'),
(134, 'Mr. Satyam Prakash Srivastava', 'x010/x010/x010', 'FCBM', 'B13', 'Assistant Professor ', 'X010', 'X010', 'X010', 'M.Com(H), MBA , NET,  Pursuing PhD', 'x', 'x', '134.jpg', '134.docx', 'Mr. Satyam Prakash Srivastava is working as Assistant Prof. in Faculty of Commerce & Business Manaement, Amrapali Group of Institutes, Haldwani.  Working experience of more than 8 years into academics since August 2009. Completed M.Com in June 2017, Pursuing P.hD from Uttarakhand Technical University, Dehradun. Presented research papers in National Seminars and published several papers in the areas of Financial Inclusion and Impact of Microfinance. Working as Exam Cell Coordinator since last 4 years in the department.\r\n', 'satyamprakash07@gmail.com', '7895685459', 'dirmba', 1, '2017-12-23 13:30:07'),
(135, 'Mr. Amanjeet Singh Sethi ', 'x010/x010/x010', 'FCBM', 'B14', 'Assistant Professor', 'X010', 'X010', 'X010', 'PhD(Management), MBA(Marketing), M.Com(Management), USET(Commerce), NET(Management), ', 'x', 'x', '135.jpg', '135.docx', '"Dr. Amanjeet Singh Sethi is an Assistant professor in the areas of Marketing and General Management with more than 10 years of experience in academics. He is UGC-Net, USET qualified in Management and Commerce respectively. He has done his post graduation in Management and commerce groups.During his career as a management teacher, he has participated in several national and international FDPs, Seminar and been a resource person for training programmes. He is a visiting faculty in various programs of distance and open system of learning. His area of interest includes tourism, marketing, economics, general management among others. "\r\n', 'amanjeetsinghsethi@gmail.com', '9837412525', 'dirmba', 1, '2017-12-23 13:30:07'),
(136, 'Mrs. Mamta Joshi', 'x010/x010/x010', 'FCBM', 'B15', 'Assistant Professor', 'X010', 'X010', 'X010', 'PhD.(Pursuing), MCA, BCA', 'x', 'x', '136.jpg', '136.docx', 'Mamta Joshi is working as an Assistant Professor at Faculty of Commerce and Business Management since January 2013. She is having experience more than 7 years in academic. She is BCA, MCA and currently pursuing PhD in Computer Science. During her academic career she has presented several research papers in national and international conferences. Her published work includes research papers in national and international journals.\r\n', 'mamtahjoshi29@gmail.com', '8171392555', 'dirmba', 1, '2017-12-23 13:30:07'),
