(152, 'Mr. Javed Aalam', 'x010/x010/x010', 'FCSA', 'A27', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, Ph.D. pursuing', '2007', '-x-', '152.JPG', '152.doc', 'Javed Alam received B.Sc. (Hons) degree in Mathematics from Aligarh Muslim University, Aligarh, India and MCA (Master of Computer Applications) degree from Uttar Pradesh Technical University, Lucknow, India. He is GATE qualified and pursuing Ph.D in computer science. Presently he is an Assistant professor at Amrapali Institute of Management and Computer Applications, Haldwani, Nainital, India. He has contributed more than 6 research papers in International Journals. He presented and published more than 5 research papers in International and National Conferences. His research interest includes fuzzy logic, operation research (optimization techniques), computer programming and networking, intelligent transportation systems and simulation modeling in MATLAB.', 'javedalam4u@gmail.com', '9557592020', 'dirmca', 1, '2017-12-23 13:30:07'),
(153, 'Ms.Unzila Nawab', 'x010/x010/x010', 'FCBM', 'C24', 'Assistant Professor', 'X010', 'X010', 'X010', 'B.TECH , MBA', 'x', 'x', '153.png', '153.docx', 'Ms. Unzila Nawab is a proficient instructor as well as learner who enjoys working with her students and helping them reach for their dreams through their education. She believes an education should empower a person and help him or her make a positive contribution to our world.  She has done her B.Tech and MBA from Govind Ballabh Pant University of Agriculture & Technology. She has worked as a Management Trainee for one year. Presently, she is designated as an Assistant Professor in Faculty of Commerce & Business Management at Amrapali Group of Institutes, Haldwani, Uttarakhand.\r\n', 'unzilanawab@gmail.com', '7500724877', 'dirmba', 1, '2017-12-23 13:30:07'),
(154, 'Prof. (Dr.) Atam Parkash Papreja', 'x010/x010/x010', 'FTS', 'A0', 'Director', 'x', 'x', 'x', 'Ph. D.(Bio Fuel)', 'x', 'x', '154.jpg', 'x', 'Have 40 years of experience in industry and academics. Was responsible for turnkey execution of control and instrumentation of process industries. Was deputed to Malaysia to oversee site work at Malaysian power plant.', 'director.aits@amrapali.ac.in', '8872406878', 'diraits', 1, '2017-12-23 13:30:07');
